import { SimpleGrid, ListItem, IconButton } from '@chakra-ui/core';

const Item = (props) => {
  return (
    <ListItem>
      <SimpleGrid columns="2">
        <span>{props.product}</span>
        <span>{props.quantity}</span>
      </SimpleGrid>
    </ListItem>
  );
};

export default Item;
